The goal in this drill is to create some rhythm and in two steps get to the ball. This drill is emphasizing your final two steps (right-left) before the catch.
‚Ä¢
We want the players to feel in control of their bodies and create some rhythm and timing while moving through the ball.
‚Ä¢
In this drill I have the players keep a ball in their glove so that they get used to the feel of it and on the last cone they can explode through with their legs and work on transferring from their glove up to a good throwing position. You can even put a target to aim for when throwing.
‚Ä¢
Make sure your players use their legs and explode towards their target gaining momentum to where they are throwing! Also watch to make sure they are fielding this ball out in front and just left of center on their bodies.
‚Ä¢
Glove behind the ball. Eyes behind the glove.
‚Ä¢
I personally like to overemphasize the legs and gaining ground in drill work so that the players get used to keeping their feet moving!
